import logo from './Grupo3.png';
import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import './App.css';
import Menu from './pages/Menu';
import Login from './pages/Login';
import Cadastrar from './pages/Cadastrar';
import Editar from './pages/Editar';
import Excluir from './pages/Excluir';
import Buscar from './pages/Buscar';
import Analisar from './pages/Analisar';
import Relatorio from './pages/Relatorio';

function App() {
  return (
    <Router>
      <img src={logo} className="App-logo" alt="logo" />
      <Routes>
        <Route exact path="/*" element={<Login/>}/>
        <Route exact path="/menu" element={<Menu/>}/>
        <Route exact path="/cadastrar" element={<Cadastrar/>}/>
        <Route exact path="/excluir" element={<Excluir/>}/>
        <Route exact path="/editar" element={<Editar/>}/>
        <Route exact path="/buscar" element={<Buscar/>}/>
        <Route exact path="/analisar" element={<Analisar/>}/>
        <Route path="/relatorio" element={<Relatorio/>}/>
      </Routes>
    </Router>
  );
}

export default App;
